        <div>
            <nav className='navbar'>
                <div className="nav-logo">
                    <NavLink className="nav-logo" to="/dashboard"><img className="logo" src={logo} alt="Logo CourierHR" /></NavLink>
                </div>
                <div className="nav-content">




